(34, 1, '2024-04-10 20:03:23', '2024-04-10 23:03:23', '<!-- wp:shortcode -->[woocommerce_my_account]<!-- /wp:shortcode -->', 'Minha conta', '', 'publish', 'closed', 'closed', '', 'minha-conta', '', '', '2024-04-10 20:03:23', '2024-04-10 23:03:23', '', 0, 'http://localhost/minha-conta/', 0, 'page', '', 0),
(35, 1, '2024-04-10 20:03:23', '0000-00-00 00:00:00', '<!-- wp:paragraph -->\n<p><b>This is a sample page.</b></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h3>Overview</h3>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our refund and returns policy lasts 30 days. If 30 days have passed since your purchase, we can’t offer you a full refund or exchange.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To be eligible for a return, your item must be unused and in the same condition that you received it. It must also be in the original packaging.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Several types of goods are exempt from being returned. Perishable goods such as food, flowers, newspapers or magazines cannot be returned. We also do not accept products that are intimate or sanitary goods, hazardous materials, or flammable liquids or gases.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Additional non-returnable items:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul>\n<li>Gift cards</li>\n<li>Downloadable software products</li>\n<li>Some health and personal care items</li>\n</ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>To complete your return, we require a receipt or proof of purchase.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Please do not send your purchase back to the manufacturer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>There are certain situations where only partial refunds are granted:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul>\n<li>Book with obvious signs of use</li>\n<li>CD, DVD, VHS tape, software, video game, cassette tape, or vinyl record that has been opened.</li>\n<li>Any item not in its original condition, is damaged or missing parts for reasons not due to our error.</li>\n<li>Any item that is returned more than 30 days after delivery</li>\n</ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<h2>Refunds</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Once your return is received and inspected, we will send you an email to notify you that we have received your returned item. We will also notify you of the approval or rejection of your refund.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are approved, then your refund will be processed, and a credit will automatically be applied to your credit card or original method of payment, within a certain amount of days.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<b>Late or missing refunds</b>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you haven’t received a refund yet, first check your bank account again.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Then contact your credit card company, it may take some time before your refund is officially posted.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Next contact your bank. There is often some processing time before a refund is posted.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you’ve done all of this and you still have not received your refund yet, please contact us at {email address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<b>Sale items</b>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Only regular priced items may be refunded. Sale items cannot be refunded.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Exchanges</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We only replace items if they are defective or damaged. If you need to exchange it for the same item, send us an email at {email address} and send your item to: {physical address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Gifts</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If the item was marked as a gift when purchased and shipped directly to you, you’ll receive a gift credit for the value of your return. Once the returned item is received, a gift certificate will be mailed to you.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If the item wasn’t marked as a gift when purchased, or the gift giver had the order shipped to themselves to give to you later, we will send a refund to the gift giver and they will find out about your return.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Shipping returns</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To return your product, you should mail your product to: {physical address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You will be responsible for paying for your own shipping costs for returning your item. Shipping costs are non-refundable. If you receive a refund, the cost of return shipping will be deducted from your refund.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Depending on where you live, the time it may take for your exchanged product to reach you may vary.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are returning more expensive items, you may consider using a trackable shipping service or purchasing shipping insurance. We don’t guarantee that we will receive your returned item.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Need help?</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Contact us at {email} for questions related to refunds and returns.</p>\n<!-- /wp:paragraph -->', 'Política de reembolso e devoluções', '', 'draft', 'closed', 'closed', '', 'reembolso_devolucoes', '', '', '2024-04-10 20:03:23', '0000-00-00 00:00:00', '', 0, 'http://localhost/?page_id=35', 0, 'page', '', 0),
(36, 1, '2024-04-10 20:10:31', '2024-04-10 23:10:31', '<label> Your name\n    [text* your-name autocomplete:name] </label>\n\n<label> Your email\n    [email* your-email autocomplete:email] </label>\n\n<label> Subject\n    [text* your-subject] </label>\n\n<label> Your message (optional)\n    [textarea your-message] </label>\n\n[submit \"Submit\"]\n[_site_title] \"[your-subject]\"\n[_site_title] <pedrojuvinomicrocamp@gmail.com>\nFrom: [your-name] [your-email]\nSubject: [your-subject]\n\nMessage Body:\n[your-message]\n\n-- \nThis is a notification that a contact form was submitted on your website ([_site_title] [_site_url]).\n[_site_admin_email]\nReply-To: [your-email]\n\n0\n0\n\n[_site_title] \"[your-subject]\"\n[_site_title] <pedrojuvinomicrocamp@gmail.com>\nMessage Body:\n[your-message]\n\n-- \nThis email is a receipt for your contact form submission on our website ([_site_title] [_site_url]) in which your email address was used. If that was not you, please ignore this message.\n[your-email]\nReply-To: [_site_admin_email]\n\n0\n0\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nPlease fill out this field.\nThis field has a too long input.\nThis field has a too short input.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe uploaded file is too large.\nThere was an error uploading the file.', 'Contact form 1', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2024-04-10 20:10:31', '2024-04-10 23:10:31', '', 0, 'http://localhost/?post_type=wpcf7_contact_form&p=36', 0, 'wpcf7_contact_form', '', 0),
(37, 1, '2024-04-10 20:18:23', '2024-04-10 23:18:23', '<!-- wp:paragraph -->\n<p>Bem-vindo ao \"Valorant Vanguard\", sua fonte confiável e abrangente de notícias sobre o mundo do Valorant! Nosso site é dedicado a fornecer aos entusiastas do jogo as últimas atualizações, análises profundas, cobertura de torneios e tudo o mais relacionado ao universo competitivo de Valorant.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Na \"Valorant Vanguard\", você encontrará:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><!-- wp:list-item -->\n<li><strong>Últimas Notícias e Atualizações</strong>: Mantenha-se atualizado com as últimas atualizações do jogo, patches, ajustes de personagens e informações sobre novos mapas e modos de jogo.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong>Cobertura de Esports</strong>: Não perca nenhum detalhe dos torneios profissionais de Valorant. Oferecemos análises pré e pós-jogo, destaques das partidas mais emocionantes e entrevistas exclusivas com jogadores e equipes.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong>Guias e Estratégias</strong>: Para jogadores que desejam aprimorar suas habilidades, oferecemos guias detalhados, dicas de gameplay, estratégias de equipe e muito mais, tudo elaborado por especialistas no jogo.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong>Comunidade e Cultura</strong>: Explore o vibrante mundo da comunidade de Valorant. De memes engraçados a arte inspiradora, estamos sempre atentos às tendências e à cultura que cercam o jogo.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong>Entrevistas e Perfil de Jogadores</strong>: Conheça os profissionais por trás dos pseudônimos. Nossas entrevistas exclusivas oferecem uma visão única sobre a vida dos jogadores profissionais de Valorant, seus treinos, rotinas e aspirações.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong>Fórum e Discussões</strong>: Participe de discussões animadas com outros jogadores, compartilhe suas experiências, faça perguntas e debata os aspectos mais recentes do jogo em nosso fórum dedicado.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li><strong>Eventos e Promoções</strong>: Fique de olho em eventos especiais, competições da comunidade e promoções exclusivas que oferecemos regularmente em parceria com desenvolvedores e marcas.</li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Se você é um jogador casual em busca de dicas úteis, um competidor sério procurando se manter à frente da curva ou apenas um fã entusiasmado do Valorant, o \"Valorant Vanguard\" é o seu destino definitivo para tudo relacionado ao jogo. Junte-se a nós enquanto exploramos e celebramos o emocionante universo de Valorant!</p>\n<!-- /wp:paragraph -->', 'Valorant Vanguard', '', 'publish', 'closed', 'closed', '', 'valorant-vanguard', '', '', '2024-04-10 20:18:23', '2024-04-10 23:18:23', '', 0, 'http://localhost/?page_id=37', 0, 'page', '', 0),
